webpackJsonp([0x7fea9a258025],{419:function(A,e){A.exports={data:{markdownRemark:{html:'<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 729px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 58.0246913580247%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="alt text"\n        title=""\n        src="/static/selfmade-0e07f7e14038c4f6a94f9833ce47eeff-b9660.jpg"\n        srcset="/static/selfmade-0e07f7e14038c4f6a94f9833ce47eeff-4d3c6.jpg 200w,\n/static/selfmade-0e07f7e14038c4f6a94f9833ce47eeff-98b02.jpg 400w,\n/static/selfmade-0e07f7e14038c4f6a94f9833ce47eeff-b9660.jpg 729w"\n        sizes="(max-width: 729px) 100vw, 729px"\n      />\n    </span>\n  </span>\n  </p>\n<p>In one of my classes we recently discussed some of the writings of <a href="https://en.wikiquote.org/wiki/Che_Guevara">Che Guevara</a>.  I found myself disagreeing with a lot of his views, but there was one passage that I found particularly interesting.</p>\n<p>"Class divisions are determined by fate, but individuals can rise out of their class through work, initiative, etc. This process, and the myth of the self-made man, has to be profoundly hypocritical: it is the self-serving demonstration that a lie is the truth."</p>\n<p>In a sense, I disagree with this idea because I believe we can make a difference by working to be the best we can be.  I do however agree that no individual can rise out of their class alone.</p>\n<p>It reminded me of Arnold Schwarzenegger\'s Foreword in <a href="https://www.amazon.com/Tools-Titans-Billionaires-World-Class-Performers/dp/1328683788">Tools of Titans</a>, <a href="http://tim.blog/2016/11/07/tools-of-titans-foreword-arnold-schwarzenegger-i-am-not-a-self-made-man/">"I Am Not A Self-Made Man"</a>.</p>\n<p>Here is one of my favorite excerpts:</p>\n<p> "It is not true that I am self-made. Like everyone, to get to where I am, I stood on the shoulders of giants. My life was built on a foundation of parents, coaches, and teachers; of kind souls who lent couches or gym back rooms where I could sleep; of mentors who shared wisdom and advice; of idols who motivated me from the pages of magazines."</p>\n<p>No one, not even Arnold Schwarzenegger can make this journey alone.  It\'s up to each of us to help each other out, not because we have to, but because we want to.</p>\n<p>What can you do today to help create the next "self-made man"?</p>',frontmatter:{path:"/myth-of-the-self-made-man",title:"The Myth of the Self-made Man",date:"5-1-2017",tag:"Philosophy"}}},pathContext:{}}}});
